INSERT INTO `linea_facturacion` (`lf_fecha`, `lf_entera`, `lf_code`, `lf_year`, `lf_mes`, `lf_mensaje`, `lf_vencimiento`, `lf_creada`, `lf_actualizada`, `lf_ejecutada`, `lf_estados`, `lf_vigencia`, `lf_registro`) VALUES
('28/01/2021', 28012021, '6', '2021', 1, 'Si contaminamos el agua, el aire y el suelo que nos mantiene vivos, y destruimos la biodiversidad que permite que el sistema natural funcione, ninguna cantidad de dinero podrá salvarnos.', '2021-02-15', '2021-02-03 09:44:49', '2021-02-03 16:48:17', 1, 1, 1, '2021-01-28'),
('28/02/2020', 28022020, '4', '2020', 2, '\nSeñor usuario el cuidar nuestro recurso hidrico y estar puntual con el pago es un compromiso y responsabilidad de todos.', '2020-03-15', '2020-03-05 15:41:17', '2020-03-05 22:41:45', 1, 1, 1, '2020-02-28'),
('28/02/2021', 28022021, '6', '2021', 2, 'Si contaminamos el agua, el aire y el suelo que nos mantiene vivos, y destruimos la biodiversidad que permite que el sistema natural funcione, ninguna cantidad de dinero podrá salvarnos.', '2021-03-15', '2021-03-04 11:11:07', '2021-03-04 16:13:37', 1, 1, 1, '2021-02-28'),
('28/03/2020', 28032020, '4', '2020', 3, 'El agua es vida y el agua limpia significa salud. Cuidemosla, Responsabilidad de todos...', '2020-04-15', '2020-04-04 08:33:46', '2020-04-04 15:34:40', 1, 1, 1, '2020-03-28'),
('28/03/2021', 28032021, '6', '2021', 3, 'El agua es la única bebida para el hombre sabio. ¡Cuidemos y ahorremos! , si no lo hacemos , se nos va a acabar.', '2021-04-15', '2021-04-08 08:36:59', '2021-04-08 13:43:39', 1, 1, 1, '2021-03-28'),
('28/04/2020', 28042020, '4', '2020', 4, 'El agua es vida y el agua limpia significa salud. Cuidemosla, Responsabilidad de todos.', '2020-05-15', '2020-05-02 09:03:50', '2020-05-02 16:12:07', 1, 1, 1, '2020-04-28'),
('28/04/2021', 28042021, '6', '2021', 4, 'El agua es el elemento más importante para los seres humanos. Gracias a su presencia, el cuerpo humano puede llevar a cabo los procesos biológicos.', '2021-05-15', '2021-05-05 09:17:40', '2021-05-05 14:18:19', 1, 1, 1, '2021-04-28'),
('28/05/2020', 28052020, '4', '2020', 5, 'Señor usuario el cuidar nuestro recurso hidrico y estar puntual con el pago es un compromiso y responsabilidad de todos.\n', '2020-06-15', '2020-06-03 08:30:52', '2020-06-03 15:33:58', 1, 1, 1, '2020-05-28'),
('28/06/2020', 28062020, '4', '2020', 6, 'La vida en la tierra depende siempre del agua.\n¡¡¡Cuidarla es in compromiso de todos!!!', '2020-07-15', '2020-07-02 06:31:08', '2020-07-02 13:32:35', 1, 1, 1, '2020-06-28'),
('28/07/2020', 28072020, '4', '2020', 7, 'La vida en la tierra depende siempre del agua. ¡¡¡Cuidarla es in compromiso de todos !!!', '2020-08-15', '2020-07-28 08:56:41', '2020-07-29 15:30:33', 1, 1, 1, '2020-07-28'),
('28/08/2020', 28082020, '4', '2020', 8, 'No dejemos que el agua se nos escape ¡Nuestra vida esta a punto de hacerlo si no la cuidamos!', '2020-09-15', '2020-09-02 07:51:49', '2020-09-02 14:53:18', 1, 1, 1, '2020-08-28'),
('28/09/2020', 28092020, '4', '2020', 9, 'La única manera de tomar conciencia sobre la importancia del agua es pasando SED.', '2020-10-15', '2020-10-02 10:11:38', '2020-10-02 17:13:34', 1, 1, 1, '2020-09-28'),
('28/1/2020', 2812020, '4', '2020', 28, 'Señor usuario el cuidar nuestro recurso hidrico y estar puntual con el pago es un compromiso y responsabilidad  de todos.', '2020-02-15', '2020-01-29 17:34:54', '2020-02-26 05:15:26', 1, 1, 1, '2020-01-28'),
('28/10/2020', 28102020, '4', '2020', 10, 'No dejemos que el agua se nos escape...¡Nuestra vida esta a punto de hacerlo si no la cuidamos!.', '2020-11-15', '2020-11-05 08:51:47', '2020-11-05 15:53:53', 1, 1, 1, '2020-10-28'),
('28/11/2020', 28112020, '4', '2020', 11, 'El acueducto \"AUACP\" Felicita a todos los usuarios que se encuentran al día con el pago del servicio. Que este año 2021 sea de muchas bendiciones y prosperidad para todos.', '2020-12-15', '2020-12-02 08:26:04', '2020-12-02 15:27:11', 1, 1, 1, '2020-11-28'),
('28/12/2019', 28122019, '3', '2019', 12, 'El acueducto AUACP Felicita a todos los usuarios que se encuentran al día con el pago del servicio.\r\n\r\nQue este año 2020 sea de muchas bendiciones y prosperidad para todos.', '2020-01-15', '2020-01-04 15:18:55', '2020-02-26 05:15:14', 1, 1, 1, '2019-12-28'),
('28/12/2020', 28122020, '4', '2020', 12, 'El acueducto \"AUACP\" Felicita a los usuarios que se encuentran al día con el pago del servicio. Que este año 2021 sea de grandes bendiciones y mucha prosperidad para todos.', '2021-01-15', '2021-01-05 09:26:52', '2021-01-05 16:59:40', 1, 1, 1, '2020-12-28');
